  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:18.945935\",\n\t\"name\": \"report-of-findings-innoko-national-wildlife-refuge-placer-mining-study\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In general the study area appears to have
  relatively high background concentrations of several metals, especially chromium,
  zinc, nickel, and possibly aluminum. In scattered samples, several of the trace
  metals appear to be in high concentrations, but these are often in control sites.
  Sites 3 and 5 appear to be the most elevated of the control sites (for sediment
  and water). As noted earlier in this report, the high chromium sediment levels in
  1988 data are possibly artifacts; this supposition is likely accurate given the
  uniformly high concentrations of chromium. Comparisons of sediment and water data
  for mined streams with appropriate controls yield no significant differences (for
  either year). Comparisons of 1987 versus 1988 data for each site yield no uniform
  trends. Although tissue mercury levels appear elevated, it does not appear to be
  caused by mining activities (elevations occur in controls as well as experimentals).
  One sample of tissue chromium appears elevated, but it does not appear to be cause
  for concern. It must be emphasized that these conclusions are based on a small set
  of data. In no case did any site exceed the sediment or water action level by an
  order of magnitude. Thus there is no evidence of gross contamination requiring immediate
  action. It will be prudent to conduct additional monitoring on a regular schedule
  (every two or three years). The frequency of sampling should be adjusted to reflect
  the degree of mining activity that may affect refuge resources. Prior to future
  sampling, your staff must submit a study plan to the Regional Contaminants Coordinator
  to secure funding.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
